void (*PeriodicTaskSound)(void);   // user function
int shootflag=0;	
int explosionflag=0;
	
int bkgdloc=0;
int shootloc=0;
int exploc=0;
//Initialize digital outputs and SysTick timer
void Sound_Init(void){
	DAC_Init();							//initialize DAC

	//SysTick Initialization
	NVIC_ST_CTRL_R = 0;
	NVIC_ST_RELOAD_R = 0; 
	NVIC_ST_CURRENT_R = 0;
	NVIC_ST_CTRL_R = 0x07; //enable with core clock and interrupts
	NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x40000000; //priority of 2
	NVIC_ST_RELOAD_R = 7255; //11.025 kHz
};
void UpdateSound(void(*task)(void)){
	PeriodicTaskSound = task;
}
void SysTick_Handler(void){	//11.025 kHz
	(*PeriodicTaskSound)();     // execute user task
}	
void Sound_Shoot(void){
	while(shootflag!=0){
		DAC_Out(shoot[shootloc]);
		shootloc= (shootloc+1)%2006;
		if(shootloc==0){
			shootflag=0;
		}
	}
};
void Sound_Bkgd(void){
	DAC_Out(bkgd[bkgdloc]);
	bkgdloc= (bkgdloc+1)%40330;
};
void Sound_Explosion(void){
	while (explosionflag!=0){
		DAC_Out(explosion[exploc]);
		exploc=(exploc+1)%10844;
		if(exploc==0){
			explosionflag=0;
		}
	}
};
